import "../style/suggestions-friend-list.css";
function mapStateToProps(state) {
  return {};
}

class FriendsSuggestionsList extends Component {
  render() {
    return (
      <ul className="container-fluid card list-group media-list">
        <li className="media">
          <a href="#" className="pull-left">
            <img
              src="https://bootdey.com/img/Content/user_1.jpg"
              alt=""
              className="rounded-circle"
            />
          </a>
          <div className="media-body">
            <span className="text-muted pull-right">
              <small className="text-muted">30 min ago</small>
            </span>

            <strong className="text-success">Martino Mont</strong>
            <p>
              Lorem ipsum dolor sit amet, consectetur adipiscing elit. Lorem
              ipsum dolor sit amet.
            </p>
          </div>
        </li>
      </ul>
    );
  }
}

export default connect(mapStateToProps)(FriendsSuggestionsList);
